import logo from "./logo.svg";
import "./App.css";

/**
 * element = <div id = "root"> hello world</div>
 * element = React.createElement("div", {id: 'root'}, 'Hello world');
 *
 */

function Feature() {
  return (
    <div className="feature">
      <img src="" alt="" className="feature-img" />
      <h3 className="feature-title">title2</h3>
      <p>
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Hic
        perspiciatis culpa deleniti error atque explicabo consequatur
        accusantium iusto beatae veniam.
      </p>
    </div>
    // parent component
  );
}
function App() {
  return (
    // children component
    <div>
      {/* <Feature></Feature>
      <Feature></Feature>
      <Feature></Feature> */}
      <Youtube
        image="https://images.unsplash.com/photo-1644982647531-daff2c7383f3?ixlib=rb-1.2.1&ixid=MnwxMjA3fDF8MHxlZGl0b3JpYWwtZmVlZHwxfHx8ZW58MHx8fHw%3D&auto=format&fit=crop&w=500&q=60"
        avata="https://images.unsplash.com/photo-1525310072745-f49212b5ac6d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=465&q=80"
        title="Learn react js"
        author="Le Duc Huy"
        page="https://www.youtube.com/watch?v=IjWuRvHyS3Q&ab_channel=Ph%E1%BA%A1mHuyHo%C3%A0ng"
      ></Youtube>

      {/* <Youtube avata="https://images.unsplash.com/photo-1525310072745-f49212b5ac6d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=465&q=80"></Youtube> */}
    </div>
  );
}

function Youtube(props) {
  console.log(props);
  return (
    <div className="youtube-item">
      <div className="youtube-img">
        <img
          src={props.image}
          alt="youtube"
          style={{ height: "250px", display: "block" }}
        />
      </div>

      <div className="youtube-footer">
        <img src={props.avata} alt="" className="youtube-avatar" />
        <div className="youtube-info">
          <h3 className="toutube-authour">{props.author}</h3>
          <h4 className="youtube-title">{props.title}</h4>
        </div>
      </div>
      <div className="youtube-page">
        <h2>{props.page}</h2>
      </div>
    </div>
  );
}

export default App;
